    [],nt"revision_timestamp": "2016-06-08T03:06:33.403573",nt"name": "mean-annual-water-budget-components-for-the-island-of-oahu-hawaii-for-current-conditions-2001-1",nt"isopen":
    false,nt"url": null,nt"notes": "The shapefile associated with this metadata
    file represents the spatial distribution of mean annual water-budget components,
    in inches, for the Island of Oahu, Hawaii. The water-budget components in the shapefile
    were computed by a water-budget model for a scenario representative of current conditions
    (2001-10 rainfall and 2001-10 land cover), as described in USGS Scientific Investigations
    Report (USGS SIR) 2015-5164. The model was developed for estimating groundwater
    recharge and other water-budget components for each subarea of the model. The model-subarea
    dataset, consisting of 395,955 subareas (polygons), was generated using Esri ArcGIS
    software by intersecting (merging) multiple spatial datasets. Spatial datasets merged
    includes those that characterize the spatial distribution of hydrologic and physical
    conditions (rainfall, fog interception, irrigation, reference evapotranspiration,
    direct runoff, soil type, and land cover) that the model uses to compute groundwater
    recharge and other water-budget components. Additional spatial datasets merged into
    the model-subarea dataset include those of select geographic features that assist
    in analyzing model results. This metadata file describes the process of merging
    these spatial datasets. The shapefile attribute information associated with each
    polygon present an estimate of mean annual rainfall, fog interception, irrigation,
    septic-system leachate, runoff, canopy evaporation, actual evapotranspiration, storm-drain
    capture, net precipitation, total evapotranspiration, recharge, and seepage from
    water main, reservoirs, and cesspools. This shapefile also includes select geographic
    and land-cover attributes of the polygons. Brief descriptions of the water-budget
    components and attributes are included in this metadata file. Refer to USGS SIR
    2015-5164 and SIR 2015-5010 for further details of the methods and sources used
    to determine these components and attributes.",nt"license_title": null,nt"extras":
